import React from 'react'
import GoiCuon from '../assets/img/goi-cuon.png'
// import GoiBo from '../assets/img/goi-bo.'


const ProperImage = ({image})=> {
  switch(image){
    case 'goi-cuon':
        return <image src={GoiCuon} alt={image}/>;
        // break;
    default:
        console.error('not valid image string', `props.image: ${image}`)
  }
}

export default ProperImage
